import './VaccinationSearcher.css';
import vac from './vac.jpg';
const VaccinationSearcher = () => {
    const handleClick = () =>{
        e.targer.preventDefault();
    }
    return ( 
        <div className="search">
             <img className="image" src={vac} />
           <div className="data">
            <h2>Wybierz jedno spośród dostępnych miast:</h2>
            <form >
                <select  >
          <option value="Kraków" style={{color:'black'}}>Kraków</option>
          <option value="Warszawa" style={{color:'black'}}>Warszawa</option>
          <option value="Sandomierz" style={{color:'black'}}>Sandomierz</option>
          <option value="Szczecin" style={{color:'black'}}>Szczecin</option>
          <option value="Katowice" style={{color:'black'}}>Katowice</option>
        </select>
        <button onClick ={(e =>handleClick())}>Sprawdź dostępne terminy</button>
      </form>
      </div>
        </div>
     );
}
 
export default VaccinationSearcher;
